import TopNavigation from './components/TopNavigation/TopNavigation';

function App() {
  return (
    <div>
      <TopNavigation/>
      <TopCarousel/>
      <Service/>
      <AboutUs/>
      <Category/>

    </div>
  );
}

export default App;
